When applied to a Rust module, the #[export_module] attribute generates the necessary code and metadata to allow Rhai access to its public (i.e. marked pub) functions, constants and sub-modules. This code is exactly what would need to be written by hand to achieve the same goal, and is custom fit to each exported item. All pub functions become registered functions, all pub constants become module constant variables, and all sub-modules become Rhai sub-modules. This Rust module can then be registered into an Engine as a normal module . This is done via the exported_module! macro. The macro combine_with_exported_module! can be used to combine all the functions and variables into an existing module , flattening the namespace – i.e. all sub-modules are eliminated and their contents promoted to the top level. This is typical for developing custom packages . use rhai::plugin::*; // a "prelude" import for macros #[export_module]
mod my_module { // This constant will be registered as the constant variable 'MY_NUMBER'. // Ignored when registered as a global module. pub const MY_NUMBER: i64 = 42; // This function will be registered as 'greet'. pub fn greet(name: &str) -> String { format!("hello, {}!", name) } // This function will be registered as 'get_num'. pub fn get_num() -> i64 { mystic_number() } // This function will be registered as 'increment'. // It will also be exposed to the global namespace since 'global' is set. #[rhai_fn(global)] pub fn increment(num: &mut i64) { *num += 1; } // This function is not 'pub', so NOT registered. fn mystic_number() -> i64 { 42 } // Sub-modules are ignored when the module is registered globally. pub mod my_sub_module { // This function is ignored when registered globally. // Otherwise it is a valid registered function under a sub-module. pub fn get_info() -> String { "hello".to_string() } } // Sub-modules are commonly used to put feature gates on a group of // functions because feature gates cannot be put on function definitions. // This is currently a limitation of the plugin procedural macros. #[cfg(feature = "advanced_functions")] pub mod advanced { // This function is ignored when registered globally. // Otherwise it is a valid registered function under a sub-module // which only exists when the 'advanced_functions' feature is used. pub fn advanced_calc(input: i64) -> i64 { input * 2 } }
}

