By far the easiest way to create a custom module is to call plugin::combine_with_exported_module! from within def_package! which simply merges in all the functions defined within a plugin module . In fact, this exactly is how Rhai's built-in packages, such as BasicMathPackage, are implemented. Due to specific requirements of a package , plugin::combine_with_exported_module! flattens all sub-modules (i.e. all functions and type iterators defined within sub-modules are pulled up to the top level instead) and so there will not be any sub-modules added to the package. Variables in the plugin module are ignored. // Import necessary types and traits.
use rhai::{ def_package, packages::Package, packages::{ArithmeticPackage, BasicArrayPackage, BasicMapPackage, LogicPackage}
};
use rhai::plugin::*; // Define plugin module.
#[export_module]
